import React from 'react'
import BillBoardsMovie from './BillBoardsMovie'

const BillBoardsList = ({movie}) => {
  return (
    <div>
      <BillBoardsMovie movieBillBoard= {movie}/>
    </div>
  )
}

export default BillBoardsList
